import { IconButton } from "@material-ui/core";
import AddIcon from '@material-ui/icons/Add';

const Todos = () => {
    return (
        <div className="todos">
            <div className="todos__form">
                <form>
                    <input placeholder="Enter a todo..." />
                    <IconButton type="submit">
                        <AddIcon />
                    </IconButton>
                </form>
            </div>
        </div>
    )
}

export default Todos
